import React from "react"
import style from "./style.module.scss"

import Image from "../../atoms/Image"

const Footer = () => {
    return (
        <div className={style.footer} >
            <Image src="facebook-logo.svg" alt="facebook" width="50px" />
        </div>
    )
}

export default Footer
